Based on my research, I now have comprehensive information about how to create API routes in TanStack Start v1.163.2. Let me provide you with the complete findings:

## Summary

In **TanStack Start v1.163.2**, there is **no** function called `createAPIFileRoute`. Instead, API routes are created using the standard **`createFileRoute`** function with a `server` property added to the route configuration.

### Correct Way to Create API Routes

**Import path:**
```typescript
import { createFileRoute } from '@tanstack/react-router'
```

**Function signature and usage:**

```typescript
export const Route = createFileRoute('/api/health')({
  server: {
    handlers: {
      GET: async ({ request, params }) => {
        // Your handler logic here
        return new Response(JSON.stringify({ status: 'ok' }), {
          headers: { 'Content-Type': 'application/json' }
        })
      }
    }
  }
})
```

### Handler Properties Available

The handler receives an object with:
- `request` - The HTTP request object
- `params` - Dynamic route parameters (if any)
- `context` - Optional context (if configured at route level)

### Key Points for Your Health Endpoint

For your GET `/api/health` server function returning `{ status: "ok", timestamp: ISO string }`:

```typescript
import { createFileRoute } from '@tanstack/react-router'

export const Route = createFileRoute('/api/health')({
  server: {
    handlers: {
      GET: async () => {
        const timestamp = new Date().toISOString()
        return new Response(
          JSON.stringify({ 
            status: 'ok', 
            timestamp 
          }),
          {
            status: 200,
            headers: { 'Content-Type': 'application/json' }
          }
        )
      }
    }
  }
})
```

### Key Exported Symbols in @tanstack/start

From the node_modules analysis:
- **Import from:** `@tanstack/react-router`
- **Function:** `createFileRoute` (generic file-based route factory)
- **Alternative server function approach:** `createServerFn` from `@tanstack/start-client-core` (but this is NOT for API routes - it's for RPC-style server functions)

### Important Notes

1. **API Routes vs Server Functions:** API routes use the `server.handlers` pattern within `createFileRoute`, while `createServerFn` creates RPC-style server functions that cannot be called from API routes
2. **File location:** Place your API route at `/src/routes/api/health.ts`
3. **HTTP Methods:** Define handlers for GET, POST, etc. in the `handlers` object
4. **Response format:** Must return a `Response` object (Web API standard)

### File Structure

```
src/routes/
├── api/
│   └── health.ts       // Your API route file
├── __root.tsx
└── index.tsx
