Based on the search results, here's what I found about TanStack Start API routes and `createAPIFileRoute`:

## Overview

Server routes in TanStack Start follow the same file-based routing conventions as TanStack Router. This means that each file in your routes directory with a server property in the createFileRoute call will be treated as an API route.

## createAPIFileRoute Function

The `createAPIFileRoute` is imported from '@tanstack/start/api' and is used to define API routes, with the exported variable name changed to `APIRoute`. Here's a basic example:

```typescript
import { createAPIFileRoute } from "@tanstack/start/api";

export const APIRoute = createAPIFileRoute("/api/foo")({
  GET: () => {
    return new Response('Hello world')
  }
})
```

## Dynamic Parameters

A file named routes/users/$id.ts will create an API route at /users/$id that accepts a dynamic id parameter.

## Recent Changes (2025-2026)

There has been a migration away from `createAPIFileRoute` towards using `createServerFileRoute().methods()` for newer implementations, though `createAPIFileRoute` continues to be supported and used in various integrations.

The search results show active usage of `createAPIFileRoute` in current TanStack Start projects and third-party integrations as of 2025.

