import { describe, it, expect } from 'vitest'
import { buildHealthResponse } from './health'

describe('GET /api/health', () => {
  it('returns status ok and a valid ISO timestamp', () => {
    const result = buildHealthResponse()

    expect(result).toHaveProperty('status', 'ok')
    expect(result).toHaveProperty('timestamp')
    expect(typeof result.timestamp).toBe('string')

    // Verify timestamp is a valid ISO 8601 string
    const parsed = new Date(result.timestamp)
    expect(parsed.toISOString()).toBe(result.timestamp)
  })

  it('returns a current timestamp', () => {
    const before = new Date().toISOString()
    const result = buildHealthResponse()
    const after = new Date().toISOString()

    expect(result.timestamp >= before).toBe(true)
    expect(result.timestamp <= after).toBe(true)
  })

  it('returns uptime_seconds as a non-negative integer', () => {
    const result = buildHealthResponse()

    expect(result).toHaveProperty('uptime_seconds')
    expect(typeof result.uptime_seconds).toBe('number')
    expect(result.uptime_seconds).toBeGreaterThanOrEqual(0)
    expect(Number.isInteger(result.uptime_seconds)).toBe(true)
  })

  it('shows increasing uptime over time', async () => {
    const first = buildHealthResponse()
    // Wait 1 second to observe uptime increase
    await new Promise((resolve) => setTimeout(resolve, 1100))
    const second = buildHealthResponse()

    expect(second.uptime_seconds).toBeGreaterThan(first.uptime_seconds)
  })
})

